    to check # 294 to Oregon Right to Life for $17,082.77 for wages, payroll taxes,
    and employee benefits.  All memo items on 02/29/08 belong to check # 307 to Oregon
    Right to Life for $7,721.50 for wages, payroll taxes, & payroll benefits.  Both
    memo items on 03/10 belong to check # 309 to Steve Wagner for travel to Youth
    Leadership Camp.  The memo item on 3/17/08 for $84.35 to AT&T Mobility belongs
    to check #311 to Lois Anderson for telephone.  All memo items on March 31, 2008
    for wages, payroll taxes, and employee benefits belong to check # 316 for $7,645.17
    to Oregon Right to Life. None of the checks to Oregon Right to Life for $270.83
    written on 02/05/08, 02/29/008 and 03/31/08 for postage, printing and supplies
    contained express advocacy. The State of Oregon allows a $50 per individual tax
    credit per year for Political Action Committee donations.  None of the donations
    which Right to Life/Oregon PAC received in the April 15, 2008 Quarterly Report
    were over $200 per individual and none accumulated to over $200 for the calendar
    year."
